//svgWorldMap
import svgWorldMap from "frontend/src/pages/SVG-World-Map/src/svg-world-map.js";

class MapDisplay extends Component {
  render() {
    return (
      <div>
        <script src="../src/svg-world-map.js"></script>
        <script>svgWorldMap();</script>
      </div>
    );
  }
}

export default MapDisplay;
